for(var i=0;i<allStats[0][2][0].length;i++){
  timeLine.push([]);
}
for(var region=0;region<allStats.length;region++){
  particles.push([]);
  if(allStats[region][2]===undefined){
    continue;
  }
  let day=0;
  var last=0;
  var lastRecovered=0;
  var lastDied=0;
  for(d=0;d<allStats[region][2][0].length;d++){
    for(var i=allStats[region][2][0][d]-last;i>0;i--){
      timeLine[day].push([[0,region],Math.random()]);
    }
    for(var i=allStats[region][2][1][d]-lastRecovered;i>0;i--){
      timeLine[day].push([[1,region],Math.random()]);
    }
    for(var i=allStats[region][2][2][d]-lastDied;i>0;i--){
      timeLine[day].push([[2,region],Math.random()]);
    }
    last=allStats[region][2][0][d];
    lastRecovered=allStats[region][2][1][d];
    lastDied=allStats[region][2][2][d];
    day++;
  }
}
while(timeLine[timeLine.length-1].length===0){timeLine.pop();}

for(let day=0;day<timeLine.length;day++){
  timeLine[day]=timeLine[day].sort((a,b)=> a[1]-b[1]);
  timeLine[day]=timeLine[day].map(x => x[0]);
}

var worldMap;
var popMap;
var chartMap;

function setup() {
  can=createCanvas(windowWidth, windowHeight);

  worldMap=loadImage("equal_earth.svg");
  chartMap=loadImage("world_chart.svg");
  popMap=loadImage("population_density.png");

  frameRate(5);
}

var A1 = 1.340264,
    A2 = -0.081106,
    A3 = 0.000893,
    A4 = 0.003796,
    M = Math.sqrt(3) / 2;
function equalEarth(lat,long,w,h) {
  var sv=w*PI/17;
  var lambda=long/180*PI;
  var phi=lat/180*PI;
  var l = asin(M * sin(phi));
  var l2 = l * l;
  var l6 = l2 * l2 * l2;
  return [
    w/2+sv*(lambda * cos(l) / (M * (A1 + 3 * A2 * l2 + l6 * (7 * A3 + 9 * A4 * l2)))),
    h/2-sv*(l * (A1 + A2 * l2 + l6 * (A3 + A4 * l2)))
  ];
};

function chartAt(lat,long) {
  var tp=-5.5;
  var bottom=-10;
  var c=chartMap.get(
    chartMap.width*long/360+chartMap.width/2,
    chartMap.height*(-lat+tp+90)*(180+tp-bottom)/180/180);
  return alpha(c)===255&&red(c)===0?green(c)===0?blue(c):green(c)===128?255+blue(c):-1:-1;
};

function popAt(lat,long) {

  var x=(long)/360+0.5;
  var y=0.5-(5/4*Math.log(Math.tan(Math.PI/4+Math.PI*4*lat/360/5)))/4;

  for(var PX=-1;PX<2;PX++){
    for(var PY=-1;PY<2;PY++){
      var c=popMap.get(
        (PX+popMap.width*x)>>0,
        (PY+popMap.height*y*1.1+popMap.height*0.015)>>0
      );

      switch(red(c)+","+green(c)+","+blue(c)){
        case("255,255,255"):return 0;
        case("232,232,232"):return 1;
        case("168,255,168"):return 6;
        case("255,115,0"):return 25;
        case("255,0,0"):return 70;
        case("204,0,0"):return 300;
        case("255,0,255"):return 600;
      }
    }
  }
  return -1;
};

var onDay=0;
var t=0;


var st=0;
//draw
function easyNum(n){
  if(n<1000){return n;}
  var ns=(""+n).length;
  var before=(ns-1)%3+1;
  var t="";
  if(before===3){
    t=(n+"").slice(0,before);
  }
  else{
    t=(n+"").slice(0,before)+"."+(n+"").slice(before,3);
  }
  switch(ns/3>>0){
    case(1):return t+"K";
    case(2):return t+"M";
    case(3):return t+"B";
  }
}
